💕💕💕Woww!! Solo me queda decir gracias a Dios y a ustedes chicas por esta oportunidad. No saben lo feliz que se siente mi corazón al ver las fotos y los vídeos de ese momento tan bonito que viví con ustedes. Esto significa tanto para mi, yo no sabia que se podría tener tanta pasión por algo, hasta que conocí este mundo del maquillaje donde el dinero pasa a segundo plano, cuando lo único que sientes en el alma es dar lo mejor de ti cada día, crecer paso a paso en manos De Dios. Mi corazón no sabe qu decirles, simplemente gracias. Aquí no solo tienen una maestra sino una amiga. Mil gracias por la oportunidad de que sea yo quien les hable y ponga en práctica mis conocimientos en este mundo que no ha sido facil, pero con disciplina, constancia y mucha fé seguiremos creciendo. Las amo, y las amaré por siempre.

